import React from 'react';
import Rainbow from '../hoc/Rainbow';
import { Select } from '@material-ui/core';


const uyelik = (props) => {
	// console.log(props);
	// setTimeout(() => {
	// 	  props.history.push("/about");
	// 	}, 2000);

	return (
		<div>
			<div className="container">
				<h1 className="center">FORM</h1>
                                <form className="ui form segment">
                <div className="two fields">
                    <div className="field">
                    <label>Name</label>
                    <input placeholder="First Name" name="name" type="text"/>
                    </div>
                    
                    <select class="ui dropdown">
                        <input type="hidden" name="gender"/>
                        <i class="dropdown icon"></i>
                        <div class="default text">Gender</div>
                        <div class="menu">
                            <option data-value="1">Male</option>
                            <option data-value="0">Female</option>
                        </div>
                        </select>
                    
                </div>
                <div className="field">
                    <label>Username</label>
                    <input placeholder="Username" name="username" type="text"/>
                </div>
                <div className="field">
                    <label>Password</label>
                    <input name="password" type="password"/>
                </div>
                <div className="inline field">
                    <div className="ui checkbox">
                    <input name="terms" type="checkbox"/>
                    <label>I agree to the terms and conditions</label>
                    </div>
                </div>
                <div className="ui primary submit button">Submit</div>
                <div className="ui reset button">Reset</div>
                <div className="ui clear button">Clear</div>
                </form>
      
			</div>
		</div>
	)
}


export default Rainbow(uyelik);
